import { useEffect } from "react";
import Navbar from "../../components/Navbar";
import { useDispatch } from "react-redux";
import { getMovies } from "../../api/movies";


const Home = () => {

  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(getMovies());
  }, []);


  return (
        <>
          <Navbar/>
        </>
    )
}

export default Home;
